game.TitleScreen=me.ScreenObject.extend({init:function(){this._super(me.ScreenObject,"init");this.font=null;this.fence1=null;this.fence2=null;this.logo=null},onResetEvent:function(){var b=this;game.data.newHiScore=false;me.game.world.addChild(new BackgroundLayer("bg",1));me.input.bindKey(me.input.KEY.ENTER,"enter",true);me.input.bindKey(me.input.KEY.SPACE,"enter",true);me.input.bindPointer(me.input.pointer.LEFT,me.input.KEY.ENTER);this.handler=me.event.subscribe(me.event.KEYDOWN,function(e,f,d){if(e==="enter"){me.state.change(me.state.PLAY)}});this.logo=new me.Sprite(me.game.viewport.width/2-255,me.game.viewport.height/2-20,{image:"player",framewidth:510});me.game.world.addChild(this.logo,10);var c=this;var a=me.pool.pull("me.Tween",this.logo.pos).to({y:me.game.viewport.height/2-100},1000).easing(me.Tween.Easing.Exponential.InOut).start();this.fence1=me.pool.pull("fence",0,me.video.renderer.getHeight()-100,4);this.fence2=me.pool.pull("fence",me.video.renderer.getWidth(),me.video.renderer.getHeight()-100,4);me.game.world.addChild(this.fence1,11);me.game.world.addChild(this.fence2,11);me.game.world.addChild(new (me.Renderable.extend({init:function(){this._super(me.Renderable,"init",[0,0,100,100]);this.text=me.device.touch?"Tap to start":"PRESS SPACE OR CLICK LEFT MOUSE BUTTON TO START";this.font=new me.Font("gamefont",20,"#000")},draw:function(f){var e=this.font.measureText(f,this.text);var d=me.game.viewport.width/2-e.width/2;var g=me.game.viewport.height/2+50;this.font.draw(f,this.text,d,g)}})),12)},onDestroyEvent:function(){me.event.unsubscribe(this.handler);me.input.unbindKey(me.input.KEY.ENTER);me.input.unbindKey(me.input.KEY.SPACE);me.input.unbindPointer(me.input.pointer.LEFT);this.fence1=null;this.fence2=null;this.logo=null}});